import React, {Component} from 'react'

const SearchForm = (props) => {
    return (
        <div>
            <form>
                <input type="text" name="searchBar" placeholder="Find News" />
                <button type="submit" name="submitButton">SEARCH</button>
            </form>
        </div>
    )
}

export default SearchForm
